import numpy as np
import matplotlib.pyplot as plt

def compute_sos(y_true, y_pred):
    sos = np.sum((y_true - y_pred) ** 2)
    return sos

def lin_reg(xs, ys):
    x_mean = np.mean(xs)
    y_mean = np.mean(ys)
    numerator = np.sum((xs - x_mean) * (ys - y_mean))
    denominator = np.sum((xs - x_mean) ** 2)
    b = numerator / denominator
    a = y_mean - b * x_mean
    y_pred = a + b * xs
    res = np.sum((ys - (a + b * xs))**2)
    return a, b, res

def plot_regress(x, y, y_true):
    a, b, res = lin_reg(x, y)
    y_best = b*x + a
    plt.scatter(x,  y, label="Sampled Data", color='blue')
    plt.plot(x, y_true, label="True f(x): sin(x)", linestyle='--', color='green')
    plt.plot(x, y_best, label="Line of Best Fit", linestyle='-', color='red')
    plt.grid(True)
    plt.legend()
    plt.show()

x = np.linspace(0, np.pi/4, 20)

y = generate_sin(x, 0.1)

y_true = generate_sin(x, 0)

